INSERT INTO `community` VALUES (1,1,'책상 높이 딱좋아! 책장 높이도 딱 좋아!','2023-03-02 14:59:54','community0',5),(5,1,'제발....','2023-03-03 00:42:50','community5',20),(6,1,'여러개의 사진을 등록해 보겠어요.','2023-03-03 00:44:35','community6',254),(11,2,'화이트 침구로 교체해주고 브런치 먹는 여유!! 이왕 바꾸는 김에 아이 방도 화이트 톤으로 바꾸어 주었어요!! 봄맞이에 아주 제격인 색이에요. 검은 드로우는 여기 가구다 제품인데.. 처음에 너무 어두울까 걱정이였지만, 빈티지하면서도 포인트로 딱이네요!! ','2023-03-06 16:08:17','community11',6),(12,3,'고양이 두마리와 함께 살고있습니다! 주로 뉴트롤 톤의 소품과 가구를 좋아하고 북유럽 인테리어 분위기를 좋아하는 것 같아요. 그 와중에 가끔 포인트 되는 색을 섞어주는 것을 좋아합니다!! 깨끗하면서도 생동감 넘치는 스타일!! 저 책장 너무 이쁘지 않나요? 한 벽면을 꽉채우는 책장을 가지는 것이 꿈이였는데 드디어 이루었네요!! ;)','2023-03-06 16:12:16','community12',10),(13,3,'인테리어를 하며 가장 중요하게 생각하는 것은 내 취향과 개성을 잔뜩 담아 표현하는 것이죠! 모던 인테리어에 관심이 정말 많답니다. 예전에는 뉴트럴 풍만 선호했었는데, 요새는 이런 생동감 넘치는 색들이 얼마나 아름답고 기분좋은 컬러인지!! 하루를 항상 좋은 기분으로 시작할 수 있답니다.','2023-03-06 16:16:11','community13',4),(14,4,'저는 우드톤을 너무나도 사랑하는 nickname4랍니다. 나무가 주는 특유의 향과 피톤치드는 머리를 맑게하고 마치 숲속에서 맑은 공기를 마시며 생활하는 것과 같은 기분을 주지요. 집을 따뜻한 분위기로 만들어주는 주 공신이기도 하답니다!! 가구다에서는 많은 나무 가구들을 판매하고 있어요. 여기서 산 침대 프레임은 잘 때 편백나무 향이 은은하게 나서 너무나도 기분이 좋답니다!! 오늘도 얼른 침대속으로 쏙 들어가버리고 싶네요 ㅠㅠㅠ','2023-03-06 16:19:00','community14',14),(15,5,'저희집은 창 밖의 풍경이 매우 좋죠! 그래서 통 유리창을 함으로써 그 풍경을 극대화하여 느낄 수 있도록 했어요. 대신에, 집안 구조가 다양해서 가구 배치에 정말 많은 힘을 썼어요. 한 가구 한가구를 정말 고민 고심해서 구매하였고, 지금의 상태에 너무 만족스럽습니다! 탁 트인 창을 보며 업무를 하면, 답답했던 마음도 치유가 되고, 뻥 뚫리는 기분에 효율성은 더욱 더 오릅니다!!','2023-03-06 16:22:43','community15',12),(16,3,'아기자기하게 꾸미는 것을 정말 좋아합니다! 여러 소품을 이용해서 꾸며보았어요. 길가다가 소품샵만 보면 혼을 빼앗기고 만답니다..ㅠㅠ 발품 팔아서 이것 저것 모으다보니 이쁜 아기방과 동시에 다른 방들도 인테리어를 만족스럽게 할 수 있었어요!! 아늑한 분위기는 덤입니다!!','2023-03-07 01:23:30','community16',41),(18,41,'화이팅ㅁㄴㅇㄹ','2023-03-07 06:47:09','community18',8);
