INSERT INTO `review` VALUES (26,2,'HA00G01EEU_GY','HA00G01EEU',4,'NEW\r\n별점: 5점 아주 좋아요2023.3.2\r\n에몬스 뉴루밍 LED 저상형 패밀리침대 내돈내산 구매후기\r\n\r\n아기가 태어나고 패밀리 침대를 알아보다가 급해서 먼저 매트리스만 퀸+수퍼싱글로 사서 방에서 잤어요~ 그런데 침대 프레임과 가드가 없으니 잠잘 때 너무 불편하더라구요ㅠㅠ\r\n그래서 사이즈에 맞는 프레임을 찾다가 제 기준에 딱 맞는 에몬스 뉴루밍 LED 저상형 패밀리침대를 구입했어요^^\r\n\r\n만족도\r\n일단 아이가 너무너무 좋아해서 원래 자러가자~ 하면 “싫어, 안잘래” 하던 아이가 먼저 방에 가서 침대에 누워있네요^^ 저와 남편이 번갈아 가며 아이 침대에서 같이 자는데 남편도 같이 낮잠을 자 보더니 “이 공간이 너무 포근해졌다.” 하며 만족하네요. 겨울이라 창문 쪽에서 약하게 바람이 들어오는데 가드가 그것도 막아주는 것 같아요. 저는 풋보드도 같이 구매해서 돌 지난 둘째도 안심하고 여기서 같이 재울 수 있을 것 같아요^^ 그리고 젤 맘에 드는 점은 LED 등과 USB 충전기가 침대 프레임에 있다는 거에요ㅠㅠ 아이랑 같이 불을 끄고 누우면 아이 베개를 머리에 대 주기 힘들어서 다시 불을 키러 갔다오고 했었는데 이제는 방에 불을 꺼도 LED 등이 있으니 너무너무 편하네요^^ 머리맡에서 폰을 충전할 수 있어서 또 너무 편합니당~~\r\n\r\n퀄리티\r\n네*버에서 저상형 패밀리침대라고 검색하면 나오는 많은 패밀리침대 중 에몬스를 선택한 가장 큰 이유는 탄탄해보여서였어요. 같은 모양이지만 에몬스의 반 값 정도인 패밀리침대들도 많았지만 소재가 패브릭이라 관리가 어려워 보이거나 실제로 기사님이 집에 와서 설치해보니 너무 허술해서 후회한다는 리뷰가 많더라구요. 그래서 일단 패브릭으로 된 소재를 거르고 가죽 또는 인조가죽을 찾아보기 시작했어요. 그리고 퀸+수퍼싱글을 결합하는 부분의 튼튼함도 상세페이지에서 자세히 봤죠. 에몬스가 딱이더라구요^^ 그리고 제일 중요한건 냄새가 안나요!! 다른 침대들은 설치 후 냄새가 나서 머리가 아프다는 리뷰를 너무 많이 봤었는데 이건 설치한 당일날도 냄새가 안나네요^^','2023-02-25 04:17:33','review26'),(63,1,'HA00G01EEU_GY','HA00G01EEU',5,'여자아이라서 초등학교 저학년에 맞춤되는 핑크가 가득한 책상으로 사주려고 했으나 1~2년 쓰고 버리기에는 너무 책상 가격이 비싸기에 저는 오래쓸 수 있는 무난한 책상으로 골랐는데 아주 잘한 선택이었어요~..\r\n\r\n1. 디자인_ 지루하지 않게 깔끔하게~무난하게~ 오래 쑬 수 있는 디자인으로 아주 좋으며 5단 구성이 답답함이 없는 디자인이라 더욱좋아요.\r\n\r\n2. 1400 사이즈로 하길 잘했다. - 올려놓다보면 책이 여러가지가 나와있게 되는데 다 커버됩니다. 또한 사이즈가 넓다 보니 의자 하나만 놓으면 동생도 같이 쓸 수 있으니 일석이조 아주 좋아요~\r\n\r\n3. 가성비 좋은 가격 최고 _ 1400사이즈, 상부도어, 조명과 콘센트까지 선택한 비용은 타 브랜드와 비교시 가격이 에몬스가 저렴합니다. 차이점은 책상두께정도인데...\r\n\r\n받아보니 전에는 걱정이 많았어요~ 얇지는 않을까~ 흔들리면 어쩌나 하구요~ 하지만 괜한\r\n걱정이었습니다. 아주 튼튼하게 설치해주셨어요~\r\n\r\n우리아이 책상에 들여논 후로 아주 잘 책상에서 공부하네요~ 이걸로 1학년 새학기 준비는 다했네요~\r\n','2023-03-03 09:25:06','review63'),(71,1,'HXL70Y12EL_FIVGYM','HXL70Y12EL',3,'ㅊㅍㅊㅍㅊㅍㅊㅍㅊㅍㅊ','2023-03-05 08:39:14','review71'),(72,1,'HB7209F_A441D','HB7209F',4,'?!?!??!?!?!?!??!?!?','2023-03-05 08:39:52','review72'),(74,1,'HSRE06SS_3W1OS','HSRE06SS',3,'dsfadf','2023-03-05 08:54:01','review74'),(75,1,'HSRE06SS_3W1OS','HSRE06SS',4,'ㅁㄴㅇㄹㅁㄴㄹㅁㄴㅇㄹㅇㄴ','2023-03-05 08:54:23','review75'),(77,1,'PDT001_001','PDT001',4,'test','2023-03-06 08:05:35','review_1'),(78,1,'PDT001_001','PDT001',4,'test','2023-03-06 08:06:36','review_1'),(82,1,'HSO124BN_GUDN','HSO124BN',5,'왕왕 굳 짱짱맨','2023-03-06 13:07:28','review82'),(83,10,'HSQE05_FIVLA','HSQE05',5,'우왕 멋져용','2023-03-06 14:43:02','review83'),(86,34,'HA00G01EEU_GY','HA00G01EEU',2,'배송은 이주정도 걸린거 같아서 화나요 기사님이 친절 하셨어요 처음 받자마자 새가구 냄새가 많이 나서 문 옆어놓고 공기청정기 풀로 돌렸네요\r\n 다만 성인 한명이 자기에는 조금 좁은 감은 있어서 청소년기 아이들은 괜찮을꺼 같아요 저희 아이는 중3인데 등치가 좀 있는데 좀 좁다고는 하네요 ~ 그래도 구성이 좋고 예뻐서 고3때까지는 쓰려구요 ~','2023-03-07 03:05:07','review86');
